import React, { useState } from "react";
import '../assets/styles/CareerBento.scss';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faMapMarkerAlt, faChartLine, faTools } from '@fortawesome/free-solid-svg-icons';

// Using your existing photos for the backgrounds
const imgMumbai = require('../assets/images/1.png'); 
const imgNYC = require('../assets/images/2.png'); 

type EntryKey = 'mumbai_univ' | 'lti' | 'binghamton' | 'klaw';

function CareerBento() {
  const [activeTab, setActiveTab] = useState<EntryKey>('klaw');
  const [animating, setAnimating] = useState(false);

  const careerData = {
    mumbai_univ: {
      org: "University of Mumbai",
      title: "Bachelor of Engineering",
      location: "Mumbai, India",
      date: "2017 - 2021",
      logo: "https://d2lk14jtvqry1q.cloudfront.net/media/large_KJ_Somaiya_College_of_Engineering_Mumbai_7ff486798c_9b4de395b4.png",
      bg: imgMumbai,
      url: "https://mu.ac.in/",
      impact: "Top 10% of Class",
      tools: ["Java", "Data Structures", "C++"],
      details: ["Major in Computer Engineering.", "First Class with Distinction."]
    },
    lti: {
      org: "LTIMindtree",
      title: "Software Engineer",
      location: "Mumbai, India",
      date: "2021 - 2023",
      logo: "https://upload.wikimedia.org/wikipedia/commons/thumb/9/9f/LTIMindtree_Logo.svg/960px-LTIMindtree_Logo.svg.png",
      bg: imgMumbai,
      url: "https://www.ltimindtree.com/",
      impact: "65% Latency Reduction",
      tools: ["Spring Batch", "Drools", "SQL"],
      details: ["Optimized financial microservices.", "Modernized legacy PL/SQL systems."]
    },
    binghamton: {
      org: "Binghamton University",
      title: "Master of Science, CS",
      location: "New York, USA",
      date: "2023 - 2025",
      logo: "https://upload.wikimedia.org/wikipedia/en/6/67/State_University_of_New_York_at_Binghamton_Seal.png",
      bg: imgNYC,
      url: "https://www.binghamton.edu/",
      impact: "3.9+ GPA",
      tools: ["Systems", "Data Science", "Python"],
      details: ["Specialization in Data Science.", "Graduate Assistant."]
    },
    klaw: {
      org: "KLAW Industries",
      title: "Software Engineer Intern",
      location: "Binghamton, NY",
      date: "2024 - 2025",
      logo: "https://images.squarespace-cdn.com/content/v1/5cfee7779de45a000197fd31/1622649420794-QC687JBOL698CEBAZOTH/KLAW+Industries+Transparent.png",
      bg: imgNYC,
      url: "https://www.klawindustries.com/",
      impact: "40% Faster Ingestion",
      tools: ["AWS IoT", "Kinesis", "Linux"],
      details: ["Built real-time video pipelines.", "Managed multi-sensor telemetry."]
    }
  };

  const handleTabChange = (key: EntryKey) => {
    setAnimating(true);
    setTimeout(() => {
      setActiveTab(key);
      setAnimating(false);
    }, 300);
  };

  const current = careerData[activeTab];

  return (
    <div className="career-dashboard-container" id="career">
      {/* Dynamic Background Image */}
      <div className="dashboard-bg-overlay" style={{ backgroundImage: `url(${current.bg})` }}></div>

      <div className="dashboard-content-wrapper">
        <h1>Career Journey</h1>

        <div className="dashboard-layout">
          <div className="timeline-sidebar">
            {(Object.keys(careerData) as EntryKey[]).map((key) => (
              <div 
                key={key} 
                className={`timeline-item ${activeTab === key ? 'active' : ''}`}
                onClick={() => handleTabChange(key)}
              >
                <div className="dot"></div>
                <div className="timeline-info">
                  <span className="date">{careerData[key].date}</span>
                  <span className="org">{careerData[key].org.split(' ')[0]}</span>
                </div>
              </div>
            ))}
            <div className="vertical-line"></div>
          </div>

          <div className={`details-view ${animating ? 'exit' : 'enter'}`}>
            <div className="details-header">
              <a href={current.url} target="_blank" rel="noopener noreferrer">
                <img src={current.logo} alt="Logo" className="header-logo" />
              </a>
              <div className="header-text">
                <h2>{current.org}</h2>
                <h3>{current.title}</h3>
                <p><FontAwesomeIcon icon={faMapMarkerAlt} /> {current.location}</p>
              </div>
            </div>

            <div className="details-grid">
              <div className="detail-card impact">
                <h4><FontAwesomeIcon icon={faChartLine} /> Impact</h4>
                <p>{current.impact}</p>
              </div>
              <div className="detail-card tools">
                <h4><FontAwesomeIcon icon={faTools} /> Tools</h4>
                <div className="skill-pills">
                  {current.tools.map(tool => <span key={tool}>{tool}</span>)}
                </div>
              </div>
              <div className="detail-card contributions">
                <h4>Highlights</h4>
                <ul>{current.details.map((item, i) => <li key={i}>{item}</li>)}</ul>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default CareerBento;
